import React, {memo, useState, useRef, useCallback, useEffect} from 'react';
import styled from 'styled-components';
import {NavLink} from 'react-router-dom';

import Title from '../../components/TitleContainer';

import { useSelector, useDispatch } from 'react-redux';
import { getList } from '../../slices/MonSupContentSlice';

const IndexContainer = styled.div`
    .contentContainer{
        color:#333333;
        width:100%;
        
        .contentWrap{
            .popularWrap{
                margin:120px auto 100px;
                border-radius: 10px;
                max-width:1200px;
                height: auto;

                .title{
                    font-size:30px;
                    height: auto;
                    width:max-content;
                    margin: 0 auto;
                    font-weight: 600;
                }

                .popContent{
                    margin-top:50px;
                    display: flex;
                    width:100%;
                    height:300px;
                    border-radius: 10px;
                    border:1px solid #d9d9d9;
                    background-color: #ffffff;
                    box-shadow: 1px 1px 30px rgba(100, 100, 100, 0.1);

                    .imgWrap{
                        width:480px;
                        height: auto;
                        background-color: #d9d9d9;
                        border-radius: 10px 0 0 10px;
                        background-image: url('/img/monsup/money01.jpg');
                    }

                    .textWrap{
                        display: flex;
                        align-items: center;
                        padding-left:54px;

                        .textInner{
                            .tit{
                                font-size:26px;
                                font-weight: 600;
                                margin-bottom:16px;
                            }

                            .txt{
                                font-size:16px;
                                margin-bottom:6px;
                            }

                            .period{
                                color:#959595;
                                margin-bottom:28px;
                            }

                            .countdown{
                                width:350px;
                                height: 100px;
                                border: 1px solid #d9d9d9;
                                border-radius: 10px;

                                display: flex;
                                align-items: center;
                                justify-content: center;

                                font-size:50px;
                                font-weight: 700;
                            }
                        }
                    }
                }
            }

            .contentListContainer{
                background-color:#F9F9F9 ;
                width:100%;

                .contentListWrap{
                    max-width: 1200px;
                    margin:0 auto;
                    padding-top:80px;

                    .total{
                        text-align: center;
                        font-size: 24px;
                        margin:90px 0 50px;

                        .point{
                            font-size:inherit;
                            color:#34964b;
                        }
                    }

                    .searchWrap{
                        /* margin-top:120px; */
                        border:1px solid #B3B3B3;
                        background-color: #ffffff;
                        border-radius: 10px;
                        padding:32px 50px;
                        color:#333333;
                        display: flex;
                        align-items: center;
                        justify-content: center;

                        label{
                            font-size:18px;
                            font-weight: 500;
                            margin-right:20px;
                        }

                        select, input {
                            border:1px solid #959595;
                            border-radius: 4px;
                            height: 38px;
                            margin-right:40px;
                            padding:0 14px;
                        }

                        .keySearchWrap{
                            .keySearch{
                                margin-right:0;
                            }
                        }
                    }

                    .listWrap{
                        display: flex;
                        flex-wrap: wrap;

                        .listItem{
                            width:285px;
                            margin-left:20px;
                            border-radius:10px;
                            border:1px solid #D9D9D9;
                            height:330px;
                            margin-bottom:40px;
                            background-color: #ffffff;

                            &:first-child{margin-left:0;}
                            &:nth-child(5n){margin-left:0;}

                            .link{
                                display: block;

                                .imgWrap{
                                    background-color: #d9d9d9;
                                    height: 200px;
                                    border-radius: 10px 10px 0 0;

                                    .img{
                                        width:100%;
                                        object-fit: cover;
                                    }
                                }

                                .textWrap{
                                    padding:20px;

                                    .title{
                                        font-size:20px;
                                        font-weight: 600;
                                        height: auto;
                                        margin-bottom:8px;
                                        width:100%;
                                        display: block;
                                        
                                        white-space: nowrap;
                                        overflow: hidden;
                                        text-overflow: ellipsis;
                                    }

                                    .subTit{
                                        font-size:14px;
                                        color:#959595;
                                        width:100%;
                                        text-overflow: ellipsis;
                                        white-space: nowrap;
                                        overflow: hidden;

                                    }

                                    .progWrap{
                                        margin-top:16px;
                                        display: flex;
                                        justify-content: space-between;
                                        width:100%;
                                        height: auto;
                                        align-items: center;

                                        .progress{
                                            font-size:12px;
                                            width:50px;
                                            height: 22px;
                                            border-radius:20px;
                                            border:1px solid #34964b;
                                            color:#34964b;
                                            display: flex;
                                            align-items: center;
                                            justify-content: center;

                                            &.end{
                                                background-color:#f5f5f5;
                                                border:0;
                                                color:#959595;

                                            }
                                        }

                                        .date{
                                            font-size:14px;
                                            color:#959595;
                                        }
                                    }
